sys_variable_value.value:
(function execute(inputs, outputs) {
    var data = new Array();
    var document;
    if (inputs.status_code == '200') {
      var response_json = JSON.parse(inputs.response_body);
      for (var i = 0; i < response_json.accounts.length; i++) {
        document = new Object();
        document.label = response_json.accounts[i].name;
        document.name = response_json.accounts[i].email;
        data.push(document);
      } 
      var documents = new Object();
      documents.data =  data;
      outputs.documents = documents;
      outputs.status = "Success";      
    } else {
      outputs.error_message = new GoogleIdentityAccessErrorHandler().documentErrorHandler(inputs, outputs); 
    }  

})(inputs, outputs);

